import React, {useEffect} from 'react';
import BentoGrid from "@bentogrid/core";
import downArrow from '../assets/down-arrow-svgrepo-com.svg';

const NewHome = () => {
    useEffect(() => {
        const myBento = new BentoGrid({
            target: '.bentogrid',
            cellGap: 10,
            balanceFillers: false,
            columns: 4,
        });
      }, []);
    
    return (
        <div className='backgroundNew center'>
            <div className='boxes'>
                <div class="bentogrid">
                    <div className='box boxCreateNewProject' data-bento="1x1">
                        <h1 className='boxTitle'>Create <br /> New Project</h1>
                    </div>
                    <div className='box boxBox-search' data-bento="2x1">
                        <h1 className='Title'>Search</h1>
                        <input className='search' type="text"/>
                    </div>
                    <div className='box' data-bento="2x1">
                    <div className='box-projects'>
            <h1 className='Title'>Recent activity</h1>
            {lastProjects.localProjects.map((item, index) => (
            <motion.div onClick={() => {navigate(`project/${item}`)}} key={index} whileHover={{scale: 1.05}} initial={{ scale: 0 }} animate={{ scale: 1 }} transition={{ type: "spring", duration: 0.7 }} className='project-box-load'>
              <span className='project-box-header'>{item}</span>
              <span>----------- | -----------</span>
            </motion.div>
            ))}

          </div>
                    </div>
                    <div className='box' data-bento="1x2"><span>wfeff</span></div>
                    <div className='box boxBox-arrow-down' data-bento="1x1">
                        <div className='boxBox-arrow-down'>
                            <img src={downArrow} alt="" />
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default NewHome;
